import React, { useEffect, useMemo, useState } from 'react';
import {
  Container,
  Typography,
  Paper,
  Grid,
  useTheme,
  Box,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Button,
  Chip,
  Tooltip,
} from '@mui/material';

const DAYS = ['monday', 'tuesday', 'wednesday', 'thursday', 'friday'];
const PERIODS = [1, 2, 3, 4, 5, 6];

const accentChip = (theme) => ({ borderColor: theme.palette.primary.main, color: theme.palette.primary.main, backgroundColor: '#fff' });

const StudentTimetable = () => {
  const theme = useTheme();
  const API = process.env.REACT_APP_API_URL || 'http://localhost:3001/api';

  const [classes, setClasses] = useState([]);
  const [subjects, setSubjects] = useState({});
  const [selectedClass, setSelectedClass] = useState('');
  const [schedule, setSchedule] = useState({});

  useEffect(() => {
    // Load classes and subjects list, auto-select the first class
    const load = async () => {
      const [clsRes, subRes] = await Promise.all([
        fetch(`${API}/classes`),
        fetch(`${API}/subjects`),
      ]);
      const [cls, subs] = await Promise.all([clsRes.json(), subRes.json()]);
      setClasses(cls);
      const map = {};
      subs.forEach((s) => (map[s.id] = s.name));
      setSubjects(map);
      if (cls && cls.length > 0) {
        setSelectedClass(String(cls[0].id));
        try {
          const ttRes = await fetch(`${API}/timetables/class/${cls[0].id}`);
          const tt = await ttRes.json();
          setSchedule(tt?.schedule || {});
        } catch (_) {}
      }
    };
    load().catch(() => {});
  }, [API]);

  const handleLoadTimetable = async () => {
    if (!selectedClass) return;
    const res = await fetch(`${API}/timetables/class/${selectedClass}`);
    const data = await res.json();
    setSchedule(data?.schedule || {});
  };

  // Single-accent design: no color legend needed

  const renderCell = (day, period) => {
    const dayArr = schedule?.[day] || [];
    const sess = dayArr.find((s) => s.period === period);
    if (!sess) return null;
const name = subjects[sess.subject_id] || `SUB-${sess.subject_id}`;
    return (
      <Tooltip title={sess.room ? `Room ${sess.room}` : ''} placement="top" arrow>
        <Chip label={name} size="small" variant="outlined" sx={accentChip(theme)} />
      </Tooltip>
    );
  };

  return (
    <Container sx={{ mt: 6, mb: 6 }}>
      <Typography variant="h4" fontWeight="bold" gutterBottom color={theme.palette.primary.main}>
        Student Timetable
      </Typography>

      <Box sx={{ display: 'flex', gap: 2, mb: 2, alignItems: 'center' }}>
        <FormControl sx={{ minWidth: 240 }}>
          <InputLabel id="class-select-label">Class</InputLabel>
          <Select
            labelId="class-select-label"
            label="Class"
            value={selectedClass}
            onChange={(e) => setSelectedClass(e.target.value)}
          >
            {classes.map((c) => (
              <MenuItem key={c.id} value={c.id}>
                {c.name}{c.section ? ` - ${c.section}` : ''}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <Button variant="contained" onClick={handleLoadTimetable} disabled={!selectedClass}>
          Load Timetable
        </Button>
      </Box>

      <Paper elevation={8} sx={{ p: 3, borderRadius: 3, overflowX: 'auto', boxShadow: '0px 4px 20px rgba(0, 0, 0, 0.1)' }}>
        <Grid container spacing={0} sx={{ minWidth: 720 }}>
          <Grid item xs={2} sx={{ borderBottom: 1, borderRight: 1, borderColor: 'divider', p: 1, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <Typography variant="subtitle1" fontWeight="bold">Time / Day</Typography>
          </Grid>
          {DAYS.map((day) => (
            <Grid key={day} item xs={2} sx={{ borderBottom: 1, borderRight: 1, borderColor: 'divider', backgroundColor: theme.palette.action.hover, p: 1, textAlign: 'center', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
              <Typography variant="subtitle1" fontWeight="bold">{day.charAt(0).toUpperCase() + day.slice(1)}</Typography>
            </Grid>
          ))}
          {PERIODS.map((p) => (
            <React.Fragment key={p}>
              <Grid item xs={2} sx={{ borderBottom: 1, borderRight: 1, borderColor: 'divider', p: 1, fontWeight: 'medium', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>{`Period ${p}`}</Grid>
              {DAYS.map((day) => (
                <Grid key={`${day}-${p}`} item xs={2} sx={{ borderBottom: 1, borderRight: 1, borderColor: 'divider', p: 1, minHeight: 60, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
                  {renderCell(day, p)}
                </Grid>
              ))}
            </React.Fragment>
          ))}
        </Grid>
      </Paper>
    </Container>
  );
};

export default StudentTimetable;
